import React, { useState, useEffect } from "react";
import axios from 'axios';

var arrobjs = [];
var today = new Date();


const Log = () => {

   const [logs, setLogs] = useState({});
   const [update, setUpdate] = useState({});

   useEffect(() => {
     const interval = setInterval(() => {
       console.log ('this will run every two secs!');

    axios.get('https://join.reckon.com/stock-pricing')
      .then(res => {
        console.log(res)
        setLogs(res.data)
        arrobjs.push(logs);
        setUpdate(today.getHours() + ":" + today.getMinutes() + ":" + today.getSeconds());
        console.log(update);
        console.log(arrobjs);


      })
      .catch(err => {
        console.log(err)
      })
    },10000);
    return () => clearInterval(interval);
  },[]);

  return (
    <div className ="log-box">
      <ul>
        {
         Object.keys(logs).map((item, i) => (
            <li  key={i}>
            <span >{ logs[item].code }: ${logs[item].price} </span>
              </li> ))


        }

      </ul>
    </div>
  );
};

export default Log

